# I'm not going to go through and comment this, the code is disgusting, if you want to know how it works, look at testSendCamera.py	
import asyncio
import websockets
import base64
import glob
import cv2

def encode_img(image):
	retval, bffr = cv2.imencode('.jpg', image)
	return base64.b64encode(bffr).decode("utf-8") 

counter = 0
images = []

for img in glob.glob("images/*.png"):
    n = cv2.imread(img)
    images.append(n)

print("loaded images")

async def time(websocket, path):
	global counter
	while True:
		encoded_img = encode_img(images[counter%len(images)])
		#print(type(encoded_img))
		counter += 1
		await websocket.send(encoded_img)
		#await websocket.send("")
		await asyncio.sleep(0.001)

start_server = websockets.serve(time, '127.0.0.1', 5678)

asyncio.get_event_loop().run_until_complete(start_server)
asyncio.get_event_loop().run_forever()